import "../App.css";
import 'bootstrap/dist/css/bootstrap.min.css';
import * as React from "react";
import * as Icon from 'react-bootstrap-icons';
import {Container, Row, Col} from "react-bootstrap";

function Header() {
    return <div>
        <p className="header-title">MyClinic <Icon.Clipboard2Pulse /></p>
    </div>
}

function HomeContent() {
    return <Container>
        <Row className="home">
            <Col lg={7}>
                <p className="tagline-title">Wait for the doctor in your comfort</p>
            </Col>
            <Col lg={5}>
                <img src={require("../img/queue_clipart.png")} alt="queue clipart"></img>
            </Col>
        </Row>
    </Container>
}

export {HomeContent, Header};
